import React from 'react'
import './Person.css'
const Preson = (arg)=> {
return (<div className="Person_css">
        <p onClick={arg.click} ><mark style="color:blue ;">Name </mark>: {arg.name} Id : {arg.Id}</p>
        <p>Id : {arg.Id}</p>
        <p>summary : {arg.summary}</p>
    </div>)
};

export default Preson;
